package hpt.has.shinhan.xml;

import javax.xml.parsers.*;
import org.xml.sax.InputSource;

import hpt.has.shinhan.filenet.PropertiesTemplate;

import org.w3c.dom.*;
import java.io.*;
import java.util.ArrayList;
import java.util.List;

public class ReadXML {
	
	public static String getCharacterDataFromElement(Element e) 
	{
		 try {
			 Node child = e.getFirstChild();
			 if (child instanceof CharacterData) 
			 {
				 CharacterData cd = (CharacterData) child;
				 return cd.getData();
			 }
			 
		 }
		 catch(Exception ex) {
			 
			 System.out.println("hpt.has.shinhan.xml.ReadXML.getCharacterDataFromElement.Error: " + ex);
		 }
		 return "?";
	}
		
	public static PropertiesTemplate getPropertiesTemplateDataFromXML(String xml, String node) {
		
		PropertiesTemplate result = new PropertiesTemplate();
		
		try {
	        DocumentBuilderFactory dbf =
	            DocumentBuilderFactory.newInstance();
	        DocumentBuilder db = dbf.newDocumentBuilder();
	        InputSource is = new InputSource();
	        is.setCharacterStream(new StringReader(xml));

	        Document doc = db.parse(is);
	        NodeList nodes = doc.getElementsByTagName(node);

	        // iterate the employees
	        for (int i = 0; i < nodes.getLength(); i++) {
	           Element element = (Element) nodes.item(i);

	           for(int j = 0; j < result.list.size(); j++) {
	        	   
	        	   NodeList name = element.getElementsByTagName(result.list.get(j));
		           Element line = (Element) name.item(0);
		           System.out.println(result.list.get(j) + ": " + getCharacterDataFromElement(line));
		           PropertiesTemplate.setProperty(result, result.list.get(j), getCharacterDataFromElement(line));
	           }
	        }
	    }
	    catch (Exception e) {

	    	System.out.println("hpt.has.shinhan.xml.ReadXML.getPropertiesTemplateDataFromXML.Error: " + e);
	    }
		
		return result;
	}
	
	public static void main(String[] args)
	{
	    
		String xmlRecords =
			      "<data>" +
			      " <Body>" +
			      "   <AppFrmNo>John</AppFrmNo>" +
			      "   <LoanAgrNo>Manager</LoanAgrNo>" +
			      "   <FileContent>\r\n" + 
			      "</FileContent>" +
			      " </Body>" +
			      " <Body>" +
			      "   <AppFrmNo>thanhtn</AppFrmNo>" +
			      "   <LoanAgrNo>Clerk</LoanAgrNo>" +
			      "   <FileContent>\r\n" + 
			      "</FileContent>" +
			      " </Body>" +
			      "</data>";
		
		List<String> list = new ArrayList<>();
		list.add("name");
		list.add("title");
		
		PropertiesTemplate p = getPropertiesTemplateDataFromXML(xmlRecords, "Body");
		
		System.out.println("data: " + p.AppFrmNo);
	}
}
